window.bookSummaryJSON = "<p>Michael Valentine, veteran and former member of an elite private military company, has been recruited by the government to conduct a secret counter-terror operation in the Persian Gulf nation of Zubara. The unit is called Dead Six. Their mission is to take the fight to the enemy and not get caught. Lorenzo, assassin and thief extraordinaire, is being blackmailed by the world's most vicious crime lord. His team has to infiltrate the Zubaran terrorist network and pull off an impossible heist or his family will die. When Dead Six compromises his objective, Lorenzo has a new job: Find and kill Valentine. As allegiances are betrayed and the nation descends into a bloody civil war, Lorenzo and Valentine must face off. Two men. Two missions. Only one will win. </p>"; 
